import React, { Component } from 'react'
// import logo from "../Constant/logo"
import logo from "../Constant/logo.svg";

class NavBar extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {


    return (
      <div style={{ backgroundColor: "black", width: "100vw", height: 52 }}>
        <div style={{ backgroundColor: "blue", width: 40, height: 40 }}>
          <img src="logo.svg"/>
        </div>
      </div>
    );
  }
}

export default NavBar;
